import React from "react";
import classes from "./Money.module.css";

function Money() {
  return (
    <div className={classes.container}>
      <div className={classes.cards}>
        <div>Funded</div>
        <div>Community Contributions</div>
        <div>Buidls</div>
        <div>Active Builders</div>
      </div>
    </div>
  );
}

export default Money;
